import React, { FunctionComponent, useCallback, useState } from "react";
import { Button, Drawer, MenuItem, List } from "@material-ui/core";
import LeftDrawerList from './LeftDrawerList'

const LeftDrawer: FunctionComponent = () => {
  const [leftSide, setLeftSide] = useState(false);


  const toggleDrawer = (side: string, open) => event => {
    if (event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
      return;
    }

    setLeftSide(open);
  };

  const _onClickMenuButton = (e: any) => {
    console.log(e);
  };

  return (
    <>
      <Button onClick={_onClickMenuButton}>게시글</Button>
      <Drawer on>
        <LeftDrawerList />
      </Drawer>
    </>
  );
};

export default LeftDrawer;
